import Card from "../UI/Card";
import styles from "./LiveChatPopup.module.css";

const LiveChatPopup = () => {
  return (
    <>
      <Card className={styles["popup"]}>
        <div>
          <div>
            <h2>Customer Support</h2>
            <button>Let's Chat App</button>
          </div>

          <div></div>
        </div>
      </Card>
    </>
  );
};

export default LiveChatPopup;
